n = 3233
leak_q = '11???1'
leak_p = '?1010?'


p = ''
q = ''
bin_n = bin(n)[2:]
print(f"{bin_n}")


def guess(a, b, i, p, q):
    conditon = 1
    if a == '?' or b == '?':
        if b == '?':
            a, b = b, a
            p, q = q, p
            conditon = 0
        a = '0'
        if last_i_bits(int(a + p, 2) * int(b+q, 2), i) != bin_n[-i:]:
            print(bin_n[-i:])
            a = '1'
        
    if conditon:
        return a + p, b + q
    else:
        return b + q, a + p
    
def last_i_bits(num, i):
    return format(num, f'0{i}b')[-i:]

index = 1
for i, j in zip(leak_p[::-1], leak_q[::-1]):
    p, q = guess(i, j, index, p, q)
    index += 1
    # print(p,q)

p = int(p, 2)
q = int(q, 2)
assert p*q == n
